(1, '<p style="text-indent: 28px; text-align: left;"><span style="font-family: 宋体; font-size: 14px; color: rgb(255, 0, 0);">注意：矫正日记将在牙齿矫正日记小程序展现、以及劲松口腔微信公众号图文推送！如您发布日记则默认您同意本协议，如不同意可联系劲松口腔微信公众号在线客服删除日记(需返还奖励)，请您知晓！</span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">1<span style="font-family:宋体">、用户发布矫正日记审核通过后，直接奖励</span><span style="font-family:Calibri">500</span><span style="font-family:宋体">元微信红包。</span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">2<span style="font-family:宋体">、矫正日记❤每达到</span><span style="font-family:Calibri">100</span><span style="font-family:宋体">的节点，奖励</span><span style="font-family:Calibri">100</span><span style="font-family:宋体">，上限</span><span style="font-family:Calibri">500</span><span style="font-family:宋体">。</span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">3<span style="font-family:宋体">、现金红包奖励活动，是为回馈劲松口腔的老患者答谢活动，目前仅限在北京劲松口腔医院矫正的用户参与。其它用户可参与发帖，但不会有奖励，请知晓！</span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">4<span style="font-family:宋体">、发帖成功并通过审核后，</span></span><span style="font-family: 宋体; font-size: 14px;">将日记首屏截图，并提供您在劲松口腔就诊时的姓名和手机号，<span style="font-family: 宋体; font-size: 14px; text-indent: 28px;">直接发送到</span><span style="font-family: 宋体; font-size: 14px; text-indent: 28px;">“劲松口腔”官方微信公众号</span><span style="font-family: 宋体; font-size: 14px; text-indent: 28px;">上，</span>与在线客服确认后，需要您在本页面</span><span style="font-family: 宋体; font-size: 14px;">点击领取，红包将直接发送到您的微信。客服工作时间：周一到周五（09：00-17：30）.</span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">5<span style="font-family:宋体">、矫正日记主要讲述您的矫正历程，从开始决定做矫正，到选择医院，选择专家，矫正方案，咬模型，第一次戴牙套，戴牙套后吃饭的难题处理方法等等，矫正中发生的的一系列事情皆可作为日记内容。</span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">6<span style="font-family:宋体">、<span style="font-size: 14px; font-family: 宋体; color: rgb(32, 88, 103);"><strong>矫正日记要求：</strong></span></span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">①<span style="font-family:Calibri">. </span><span style="font-family:宋体">字数要求至少</span><span style="font-family:Calibri">1000</span><span style="font-family:宋体">字以上；</span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">②<span style="font-family:Calibri">. </span><span style="font-family:宋体">至少上传</span><span style="font-family:Calibri">4</span><span style="font-family:宋体">张无码漏牙照片，最好包含矫正前、矫正中、矫正后对比照片；</span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">③<span style="font-family:Calibri">. </span><span style="font-family:宋体">日记中不得出现言语辱骂、淫秽等不良言论；</span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">④<span style="font-family:Calibri">. </span><span style="font-family:宋体">具体可参考已通过审核的矫正日记；</span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px">⑤<span style="font-family:Calibri">. </span><span style="font-family:宋体">日记完整度越高，越容易通过审核、获得点赞；</span></span></p><p style="text-indent:28px"><span style=";font-family:宋体;font-size:14px"><span style="font-family:宋体">⑥.<span style="font-family: 宋体; font-size: 14px; text-indent: 28px;">矫正日记发布后，仍可进行修改和日记的持续更新。</span></span></span></p><p style="white-space: normal; text-indent: 28px;"><strong><span style="font-family: 宋体; font-size: 14px;">7、矫正日记上传攻略：</span></strong></p><p style="white-space: normal; text-indent: 28px;"><strong><span style="font-family: 宋体; font-size: 14px;">①<span style="font-family: Calibri;">.&nbsp;</span>由于小程序功能性限制，编辑日记时采用分段编辑，即一段文字保存后在编辑下一段，<span style="font-family: 宋体; font-size: 14px; text-indent: 28px;">两段直接无法插入段落</span>；</span></strong></p><p style="white-space: normal; text-indent: 28px;"><strong><span style="font-family: 宋体; font-size: 14px;">②<span style="font-family: Calibri;">.&nbsp;<span style="font-family: 宋体; font-size: 14px; text-indent: 28px;">上传、删除文字或图片时，<span style="font-family: 宋体; font-size: 14px; text-indent: 28px;">需点击保存草稿方可生效</span><span style="font-family: 宋体; font-size: 14px; text-indent: 28px;">；</span></span></span></span></strong></p><p style="white-space: normal; text-indent: 28px;"><strong><span style="font-family: 宋体; font-size: 14px;">③<span style="font-family: Calibri;">.&nbsp;<strong style="text-indent: 28px; white-space: normal;"><span style="font-family: 宋体; font-size: 14px;">修改段落文字或图片时，也需要点击保存草稿方可生效；</span></strong></span></span></strong></p><p style="white-space: normal; text-indent: 28px;"><strong><span style="font-family: 宋体; font-size: 14px;">④<span style="font-family: Calibri;">.&nbsp;<span style="font-family: 宋体; font-size: 14px; text-indent: 28px;"></span></span><span style="font-family: 宋体; font-size: 14px; text-indent: 28px;"><strong style="text-indent: 28px; white-space: normal;"><span style="font-family: 宋体; font-size: 14px;"><span style="font-family: Calibri;"><span style="font-family: 宋体;">写日记时一定养成随时保存草稿的好习惯哦！</span></span></span></strong></span></span></strong></p>');
