(40, '', '（必读）矫正日记上传说明以及注意事项', '由于小程序功能性限制，编辑日记时多有不便，如果您有兴趣记录自己的矫正日记，一定要进来看看编辑过程中的注意事项哦！', '<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: 16px;">①. 由于小程序功能性限制，编辑日记时采用分段编辑；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: 16px;">②. 编辑一段文字后，点击保存草稿会自动跳转到下一段编辑；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: 16px;">③. 如需增加日记内容，点击日记最后一段文字或图片，然后点击保存，自动跳转到新段落编辑；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: 16px;">④. 两段之间无法新增新的段落哦；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: 16px;">⑤. 上传、删除文字或图片时，需点击保存草稿方可生效；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: 16px;">⑥. 修改段落文字或图片时，也需要点击保存草稿方可生效；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="font-size: 16px;">⑦. 写日记时一定养成随时保存草稿的好习惯。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; color: rgb(255, 0, 0); font-size: 16px;">注：矫正日记将在矫正日记小程序展现、以及劲松口腔微信公众号图文推送！如您发布矫正日记则默认您同意本协议，请您知晓！</span></p><p><br/></p>', 1541998856),
(37, '', '神秘“黑科技” · 69元&三分钟提前看到自己牙齿矫正后的样子！', '众所周知，牙齿矫正是一个漫长的过程。从第一次的面诊、拍片，到采集模型、戴牙套，一次次的复诊，然后看着牙齿一点点的改变，心里总会有疑问，当全部矫正完成后，自己会是什么样子呢？', '<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em; line-height: 1.5em;"><span style="font-size: 16px;">众所周知，牙齿矫正是一个漫长的过程。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em; line-height: 1.5em;"><span style="font-size: 16px;">从第一次的面诊、拍片，到采集模型、戴牙套，一次次的复诊，然后看着牙齿一点点的改变，心里总会有疑问，当全部矫正完成后，自己会是什么样子呢？</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;"><span style="font-size: 16px; box-sizing: border-box; color: rgb(112, 48, 160);">有</span>没有</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">有<span style="font-size: 16px; box-sizing: border-box; color: rgb(112, 48, 160);">没</span>有</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">有没<span style="font-size: 16px; box-sizing: border-box; color: rgb(112, 48, 160);">有</span></span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em; line-height: 1.5em;"><span style="font-size: 16px;">现在号称“黑科技”的 iTero 智能扫描仪登陆<span style="font-size: 16px; box-sizing: border-box; text-decoration-line: underline;">北京劲松口腔医院</span>，矫正前在嘴里轻轻一扫，3分钟就是见证奇迹的时刻了，可以预先看到自己做完牙齿矫正后的效果，是不是很赞 ？&nbsp;</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><br/></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">iTero口内扫描仪</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">一种快速获取、传输口腔3D数据的仪器</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><img src="https://ytrj.010kqyy.com/ueditor/php/upload/image/20181112/1541996090870963.jpg" title="1541996090870963.jpg" alt="未标题-2.jpg"/></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; white-space: normal; background-color: rgb(255, 255, 255); text-indent: 2em; line-height: 1.5em;"><span style="font-size: 16px;">它是更迭传统取模的新型仪器，给你更舒适的正畸体验，几分钟即可完成全口数字化扫描，轻松采集模型数据。可以更快速、直观的看到牙齿移动细节、矫正过程口腔环境，以及矫治完成后的效果。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><br/></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">3分钟扫描&nbsp;</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">5分钟成模型</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">10分钟预知矫正效果</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">复诊时同样轻轻一扫</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">即可对治疗进度进行评估</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center;"><img src="https://ytrj.010kqyy.com/ueditor/php/upload/image/20181112/1541996205397183.jpg" title="1541996205397183.jpg" alt="未标题-3.jpg"/></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255); text-align: center; line-height: 1.5em;"><span style="font-size: 16px;">是不是很神奇？</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; w