10kqyy.com/ueditor/php/upload/image/20181115/1542260858642722.png" title="1542260858642722.png" width="20px"/><strong style="vertical-align: super;">北京协和医院正畸教授领衔专家团队亲诊</strong><img src="https://ytrj.010kqyy.com/ueditor/php/upload/image/20181115/1542260858577529.png" title="1542260858577529.png" width="20px"/></span></p><p><br/></p><p style="text-indent:2em; margin:10px auto;">牙齿好，未来会更好，所以需要把握矫正的合适时期，一旦错过合适时期，后期矫正会更加艰难，同时也更加费时费力，也会给矫正患者造成&quot;矫正无用&quot;的印象。 因此，具有丰富矫正经验的专家对于矫正患者来说非常重要。</p><p><br/></p><p><img src="https://ytrj.010kqyy.com/ueditor/php/upload/image/20181115/1542261747611696.jpg" title="1542261747611696.jpg" width="100%"/></p><p><br/></p><p style="text-align: center; margin:10px 0 5px;"><span style="border: 1px dashed rgb(223, 96, 0);color:rgb(223, 96, 0);display: inline-block;vertical-align: middle; border-radius:5px;"><img src="https://ytrj.010kqyy.com/ueditor/php/upload/image/20181115/1542260858642722.png" title="1542260858642722.png" width="20px"/><strong style="vertical-align: super;">牙齿加速矫正，请选择诚信企业</strong><img src="https://ytrj.010kqyy.com/ueditor/php/upload/image/20181115/1542260858577529.png" title="1542260858577529.png" width="20px"/></span></p><p><br/></p><p><img src="https://ytrj.010kqyy.com/ueditor/php/upload/image/20181115/1542261766207800.jpg" title="1542261766207800.jpg" width="100%"/></p><p><br/></p><p><img src="https://ytrj.010kqyy.com/ueditor/php/upload/image/20181115/1542261766761619.jpg" title="1542261766761619.jpg" width="100%"/></p>', 1542332063),
(51, '', '（必读）发表矫正日记，领1000元现金', '现金红包奖励活动，是为回馈劲松口腔的老患者答谢活动，目前仅限在北京劲松口腔医院矫正的用户参与。其它用户可参与发帖，但不会有奖励，请知晓！', '<p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">1、用户发布矫正日记审核通过后，直接奖励500元微信现金红包。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">2、矫正日记❤每达到100的节点，奖励100，上限500。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">3、现金红包奖励活动，是为回馈劲松口腔的老患者答谢活动，目前仅限在北京劲松口腔医院矫正的用户参与。其它用户可参与发帖，但不会有奖励，请知晓！</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">4、发帖成功并通过审核后，将日记首屏截图，直接发送到劲松口腔微信公众号上，并提供您在劲松口腔就诊时的姓名和手机号，在“劲松口腔”官方微信公众号与在线客服确认后，红包将直接发送到您的微信。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">5、矫正日记主要讲述您的矫正历程，从开始决定做矫正，到选择医院，选择专家，矫正方案，咬模型，第一次戴牙套，戴牙套后吃饭的难题处理方法等等，矫正中发生的的一系列事情皆可作为日记内容。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">6、矫正日记要求：</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">①. 字数要求至少1000字以上；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">②. 至少上传4张无码漏牙照片，最好包含矫正前、矫正中、矫正后对比照片；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">③. 日记中不得出现言语辱骂、淫秽等不良言论；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">④. 具体可参考已通过审核的矫正日记；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">⑤. 日记完整度越高，越容易通过审核、获得点赞；</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; font-size: 16px;">⑥.矫正日记发布后，仍可进行修改和日记的持续更新。</span></p><p style="box-sizing: border-box; margin-top: 0px; margin-bottom: 15px; padding: 0px; outline: none; color: rgb(12, 12, 12); font-family: &quot;open sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px; text-indent: 5px; white-space: normal; background-color: rgb(255, 255, 255);"><span style="box-sizing: border-box; color: rgb(255, 0, 0); font-size: 16px;">注：矫正日记将在矫正日记小程序展现、以及劲松口腔微信公众号图文推送！如您发布矫正日记则默认您同意本协议，请您知晓！</span></p><p><br/></p>', 1543800526);
