(1077, 574, 1, '恭喜您，您的日记审核已通过', '分享一下隐适美治疗过程\n开始想做牙贴片 目标是Gakki的微笑 但由于牙齿不齐 所以决定先做矫正 本人兔子牙齿本尊 前两颗比较凸起 而且深覆合下牙齿 且有锁合 附上一张其实是自拍的牙齿图片 总之不是美美牙 不能拍抖音的买了佛冷\n首先 称赞我Dr.Li的专业性和劲松口腔合理的价位 让我毫无犹豫当天付款决定开始隐适美之路 虽然比我想象中复杂 但目前为止过程基本无痛 目前已经第八副啦', 0, 1541231293, NULL, 1, NULL, 1),
