(8168, 2516, 1, '您的日记审核未通过。', ' 这是我的牙套日记，各位准备戴牙套小姐姐和小哥哥们，分享一下，我的戴牙套经历~我从开始有整牙的想法到实施，中间经历了大概6年的时间，可谓是个漫长的过程了。从换牙后，我的牙齿就不是很齐，加上下牙有些外凸(俗称地包天),又有点歪，再加上开始，上学后，周围的小伙伴们，很多都戴了牙套，我也萌生了整牙的念头，于是让妈妈带着去看了医生，医生简单看了我的情况,说大概要1年的时间，费用大概4000元。这笔费用，在8年前，确实也很贵了，回家想了好久，也问了身边好多 朋友，大家都说整牙很痛,而且后期保持很难，好多整过的，效果', 0, 1543799135, NULL, 53, '驳回原因：您好，您的矫正日记不够丰富，字数也差很多哦，请您继续完善日记！（如有问题，您可以直接发消息到公众号与我们详细沟通）', 2),
